import React from "react";
import ReactPaginate from "react-paginate";

const Pagination = ({ values, pageCount, changePage }) => {
  return (
    <div className="pagination">
      <select name="noOfUsers" id="noOfUsers">
        {values.map((items) => (
          <option
            key={items.value.toString()}
            value={items.value}
            // onSelect={handleSelect(items.value)}
          >
            {items.value}
          </option>
        ))}
      </select>
      <ReactPaginate
        previousLabel={"<"}
        nextLabel={">"}
        pageCount={pageCount}
        onPageChange={changePage}
      />
    </div>
  );
};

export default Pagination;
